import "./PriceStyles/Prices.css";
import arrow from "./PriceStyles/up-arrow.png";
function Prices() {
  return (
    <div className="price">
      <p>Cryptocurrancy Prices By Market Cap</p>
      <div className="priceCont">
        <div>
          <p>
            $2222,222222 <p>2.3%</p>
            <img src={arrow} alt="" width="9%" height="60%" />
          </p>
          <p>Market Capitalization</p>
        </div>
        <div>
          <p>$2222,222222</p>
          <p>24h Tranding Volume</p>
        </div>
        <div>
          {" "}
          <p>$2222,222222</p>
          <p># of Coins</p>
        </div>
      </div>
    </div>
  );
}
export default Prices;
